We are now ready to write the necessary code to train our model on the MNIST dataset. Instead of a simple tensor, the model should output an item that can be understood by the learner, a struct whose responsibility is to apply an optimizer to the model. The output struct is used for all metrics calculated during the training. Therefore it should include all the necessary information to calculate any metric that you want for a task. Burn provides two basic output types: ClassificationOutput and RegressionOutput. They implement the necessary trait to be used with metrics. It is possible to create your own item, but it is beyond the scope of this guide. Since the MNIST task is a classification problem, we will use the ClassificationOutput type. impl<B: Backend> Model<B> { pub fn forward_classification( &self, images: Tensor<B, 3>, targets: Tensor<B, 1, Int>, ) -> ClassificationOutput<B> { let output = self.forward(images); let loss = CrossEntropyLoss::new(None).forward(output.clone(), targets.clone()); ClassificationOutput::new(loss, output, targets) }
} As evident from the preceding code block, we employ the cross-entropy loss module for loss calculation, without the inclusion of any padding token. We then return the classification output containing the loss, the output tensor with all logits and the targets. Please take note that tensor operations receive owned tensors as input. For reusing a tensor multiple times, you need to use the clone function. There's no need to worry; this process won't involve actual copying of the tensor data. Instead, it will simply indicate that the tensor is employed in multiple instances, implying that certain operations won't be performed in place. In summary, our API has been designed with owned tensors to optimize performance. Moving forward, we will proceed with the implementation of both the training and validation steps for our model. impl<B: ADBackend> TrainStep<MNISTBatch<B>, ClassificationOutput<B>> for Model<B> { fn step(&self, batch: MNISTBatch<B>) -> TrainOutput<ClassificationOutput<B>> { let item = self.forward_classification(batch.images, batch.targets); TrainOutput::new(self, item.loss.backward(), item) }
} impl<B: Backend> ValidStep<MNISTBatch<B>, ClassificationOutput<B>> for Model<B> { fn step(&self, batch: MNISTBatch<B>) -> ClassificationOutput<B> { self.forward_classification(batch.images, batch.targets) }
} Here we define the input and output types as generic arguments in the TrainStep and ValidStep. We will call them MNISTBatch and ClassificationOutput. In the training step, the computation of gradients is straightforward, necessitating a simple invocation of backward() on the loss. Note that contrary to PyTorch, gradients are not store alongside each tensor parameter, but are rather returned by the backward pass, as such: let gradients = loss.backward();. The gradient of a parameter can be obtained with the grad function: let grad = tensor.grad(&gradients);. Although it is not necessary when using the learner struct and the optimizers, it can prove to be quite useful when debugging or writing custom training loops. One of the differences between the training and the validation steps is that the former requires the backend to implement ADBackend and not just Backend. Otherwise, the backward function is not available, as the backend does not support autodiff. We will see later how to create a backend with autodiff support. Let us move on to establishing the practical training configuration. #[derive(Config)]
